import { Container, Row, Col } from "react-bootstrap";

export const Header = () => {
  return (
    <Container>
      <Row>
        <Col>LOrem Ipsum Dolor</Col>
        <Col>LOrem Ipsum Dolor</Col>
      </Row>
      <Row>
        <Col>1 of 3</Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  );
};
